(32,	'privacy_policy',	1,	'<p><span xss=removed><br class=\"Apple-interchange-newline\">Privacy Policy for www.OutlineGurus.com</span></p><p><span xss=removed>[Last updated:  August 6, 2021]</span></p><p><span xss=removed>This Privacy Policy describes Outline Exchange LLC\'s (\"we\", \"our\", \"Company\" and forms thereof) policies and procedures regarding the collection, use and disclosure of your information when you use www.OutlineGurus.com (the \"Website\") and tells you about your privacy rights and how the law protects you.</span></p><p><span xss=removed>We use your Personal data to provide and improve our Website. By using the OutlineGurus</span><span xss=removed>℠</span><span xss=removed> Website, you agree to the collection and use of information in accordance with this Privacy Policy.</span></p><p><span xss=removed>Interpretation and Definitions</span></p><p><span xss=removed>Interpretation</span></p><p><span xss=removed>Words which are defined in our \"Terms of Use\" (which you can find at www.OutlineGurus.com) have the same meaning here.</span></p><p><span xss=removed>Definitions</span></p><p><span xss=removed>For purposes of this Privacy Policy:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Account\" means a unique account created for you to access our Website or parts of our Website.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Business\", for purposes of the CCPA (California Consumer Privacy Act), refers to the legal entity that collects your personal information and determines the purposes and means of processing your personal information, or on behalf of which such information is collected and that alone, or jointly with others, determines the purposes and means of the processing of your personal information, and that does business in the State of California USA.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Company\" (referred to as \"Company\", \"we\", \"us\" or \"our\", and forms thereof, in this Agreement) means Outline Exchange LLC, a State of Florida USA limited liability company. For purposes of the GDPR (the EU\'s \"General Data Protection Regulation\"), the Company is the \"Data Controller\".</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Consumer\", for purposes of the CCPA, means a natural person who is a California resident. A resident, as defined in the law, includes (1) every individual who is in California for other than a temporary or transitory purpose, and (2) every individual who is domiciled in California USA but who is outside of that state for a temporary or transitory purpose.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Cookies\" are small files that are placed on your computer, mobile device or any other device by a website, containing the details of your browsing history on that website, among its many uses.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Country\" refers to: United States of America</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Data Controller\", for purposes of the EU\'s GDPR (General Data Protection Regulation), refers to the Company as the legal entity which alone, or jointly with others, determines the purposes and means of processing your Personal Data.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Device\" means any device that can access the Website, such as a computer, a cellphone or a digital tablet.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Do Not Track\" (DNT) is a concept that has been promoted by USA regulatory authorities, in particular the U.S. Federal Trade Commission (FTC), for the Internet industry to develop and implement a mechanism for allowing Internet users to control the tracking of their online activities.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Personal Data\" is any information that relates to an identified or identifiable individual.</span></p><p><span xss=removed>For purposes for the GDPR, \"Personal Data\" means any information relating to you -- such as your name, an identification number, location data, online identifier, or to one or more factors specific to your physical, physiological, genetic, mental, economic, cultural or social identity. For purposes of the CCPA, \"Personal Data\" means any information that identifies, relates to, describes or is capable of reasonably being associated with you.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Sale\", for purposes of the CCPA, means selling, renting, releasing, disclosing, disseminating, making available, transferring, or otherwise communicating orally, in writing, or by electronic or other means, a consumer\'s personal information to another business or a third party for monetary or other valuable consideration.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Service\" refers to the Website at www.OutlineGurus.com.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Service Provider\" means any natural or legal person who processes your data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Website or to assist the Company in analyzing how the Website is used. For purposes of the GDPR, Service Providers are considered \"Data Processors\".</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Third-party Social Media Service\" refers to any website or any social network website through which a user can log in or create an account to use our Service.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Usage Data\" refers to data collected automatically, either generated by the use of the Website or from the Website\'s infrastructure itself (for example, the duration of a page visit).</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Website\" refers to www.OutlineGurus.com</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"You\" means the individual accessing or using the Website, or the company or other legal entity on behalf of which that individual is accessing or using the Website, as applicable. Under the GDPR, you can be referred to as the \"Data Subject\" or as the \"User\", since you are the individual using the Service.</span></p><p><span xss=removed>Collecting and using your Personal Data</span></p><p><span xss=removed>Types of Data Collected</span></p><p><span xss=removed>Personal Data</span></p><p><span xss=removed>While using our Website, we may ask you to provide us with certain personally identifiable information that can