pan xss=removed>We use Cookies and similar tracking technologies to track the activity on our Website and store certain information. Tracking technologies used are beacons, tags, and scripts to collect and track information and to improve and analyze our Service. The technologies we use may include:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Cookies\" or \"Browser Cookies\". A \"Cookie\" is a small file placed on your Device. You can instruct your browser to refuse all Cookies or to indicate when a Cookie is being sent. However, if you do not accept Cookies, you may not be able to use some parts of our Website. Unless you have adjusted your browser setting so that it will refuse Cookies, our Service may use Cookies.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Flash Cookies\". Certain features of our Website may use local stored objects (or \"Flash Cookies\") to collect and store information about your preferences or your activity while on our Service. Flash Cookies are not managed by the same browser settings as those used for Browser Cookies. For more information on how you can delete Flash Cookies, please read \"Where can I change the settings for disabling, or deleting local shared objects?\", which is available at https://helpx.adobe.com/flash-player/kb/disable-local-shared</span></p><p><span xss=removed>objects.flash.html#main_Where_can_I_change_the_settings_for_disabling__or_deleting_local_shared_objects_</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"Web Beacons\". Certain sections of our Website and our emails may contain small electronic files known as web beacons (also referred to as clear gifs, pixel tags, and single-pixel gifs) that permit the Company, for example, to count users who have visited Website pages or opened an email and for other related Website statistics (for example, recording the popularity of a certain section, or verifying system and server integrity).</span></p><p><span xss=removed>Cookies can be \"Persistent\" or \"Session\" Cookies. Persistent Cookies remain on your personal computer or mobile device when you go offline, while Session Cookies are deleted as soon as you close your web browser. </span></p><p><span xss=removed>We use both Session and Persistent Cookies for these purposes:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Necessary / Essential Cookies</span></p><p><span xss=removed>Type: </span><span xss=removed>Session Cookies</span></p><p><span xss=removed>Administered by: Us</span></p><p><span xss=removed>Purpose: These Cookies are essential to provide you with services available through the Website and to enable you to use some of its features. They help to authenticate users and prevent fraudulent use of user accounts. Without these Cookies, the services that you have asked for cannot be provided, and we use these Cookies only to provide you with those services.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Cookies Policy / Notice Acceptance Cookies</span></p><p><span xss=removed>Type: </span><span xss=removed>Persistent Cookies</span></p><p><span xss=removed>Administered by: Us</span></p><p><span xss=removed>Purpose: These Cookies identify if users have accepted the use of Cookies on the Website.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Functionality Cookies</span></p><p><span xss=removed>Type</span><span xss=removed>: Persistent Cookies</span></p><p><span xss=removed>Administered by: Us </span></p><p><span xss=removed>Purpose: These Cookies allow us to remember choices you make when you use the Website, such as remembering your login details or language preference. The purpose of these Cookies is to provide you with a more personal experience and to avoid your having to re-enter your preferences every time you use the Website.</span></p><p><span xss=removed>Use of your Personal Data</span></p><p><span xss=removed>The Company may use Personal Data for the following purposes:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>To provide and maintain our Service, including monitoring the usage of our Service.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>To manage your Account: to manage your registration as a user of the Service. The Personal Data you provide can give you access to different functionalities of the Website that are available to you as a registered User.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>For the performance of a contract: the development, compliance and undertaking of the purchase contract for products, items or services you have purchased or of any other contract with us through the Service.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>To contact you: To contact you by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application\'s \"push notifications\" regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>To provide you with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or inquired about unless you have opted not to receive such information.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>To manage your requests: To attend to and manage your requests to us.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>For business transfers: we may use your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by us about our Website users is among the assets transferred or to be transferred.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>For other purposes: We may use your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Website, products, services, marketing and your experience.</span></p><p><span xss=removed>We may share your personal information in the following situations:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>With Service Providers: we may share your personal information with Service Providers to monitor and analyze the use of our Service, for payment processing, or to contact you.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>For business transfers: we may share or transfer your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of our business to another company.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>With Affiliates: we may share your information with our Affiliates, in which case we will require those Affiliates to honor this Privacy Policy. \"Affiliates\" include our parent company, if any, any subsidiary, joint venture partners or other companies that we control or that are under common control with us.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>With our business partners: We may share your information with our business partners to offer you certain products, services or promotions.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>With other Users: When you share personal information or otherwise interact with other Users, such information may be viewed by all Users and may be publicly distributed. If you interact with other users or register through a Third-Party Social Media Service, your contacts on the Third-Party Social Media Service may see your name, profile, pictures and description of your activity. Similarly, other Users will be able to view descriptions of your activity, communicate with you and view your profile.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>With your consent: we may disclose your personal information for any other purpose with your consent.</span></p><p><span xss=removed>Retention of your Personal Data</span></p><p><span xss=removed>The Company will retain your Personal Data for only as long as necessary for the purposes set out in this Privacy Policy. We will retain and use your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</span></p><p><span xss=removed>The Company will also retain usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when these data are used to strengthen the security or to improve the functionality of our Website, or we are legally obligated to retain the data for longer time periods.</span></p><p><span xss=removed>Transfer of your Personal Data</span></p><p><span xss=removed>Your information, including Personal Data, is processed at the Company\'s operating office and in any other places where processing is conducted. It means that this information may be transferred to — and maintained on — computers located outside of your state, province, country or other governmental jurisdiction where the data protection laws may differ from those in your jurisdiction. Your consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer. The Company will take all steps reasonably necessary to ensure that your data is treated securely and in accordance with this Privacy Policy, and that no transfer of your Personal Data will take place to an organization or a country unless there are adequate controls in place, including the security of your data and other personal information.</span></p><p><span xss=removed>Disclosure of Your Personal Data</span></p><p><span xss=removed>Business Transactions</span></p><p><span xss=removed>If the Company is involved in a merger, acquisition or asset sale, your Personal Data may be transferred. We will provide notice before your Personal Data is transferred and becomes subject to a different Privacy Policy.</span></p><p><span xss=removed>Law enforcement</span></p><p><span xss=removed>Under certain circumstances, the Company may be required to disclose your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g., a court or a government agency).</span></p><p><span xss=removed>Other legal requirements </span></p><p><span xss=removed>The Company may disclose your Personal Data in the good faith belief that such action is necessary to:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Comply with a legal obligation</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Protect and defend the rights or property of the Company</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Prevent or investigate possible wrongdoing in connection with the Service</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Protect the personal safety of Users of the Website (including you) or of the public</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Protect against legal liability</span></p><p><span xss=removed>Security of your Personal Data</span></p><p><span xss=removed>The security of your Personal Data is important to us, but remember that no method of transmission over the Internet, or method of electronic storage, is 100% secure. While we strive to use commercially acceptable means to protect your Personal Data, we cannot guarantee its absolute security.</span></p><p><span xss=removed>Detailed Information on the Processing of your Personal Data</span></p><p><span xss=removed>The Service Providers we use may have access to your Personal Data. These third-party vendors collect, store, use, process and transfer information about your activity on our Website in accordance with their own Privacy Policies.</span></p><p><span xss=removed>Your Payments</span></p><p><span xss=removed>We offer paid products and/or services within the Website. In that case, we may use third-party services for payment processing. We will not store or collect your payment card details. That information is provided directly to our third-party payment processors, whose use of your personal information is governed by their own Privacy Policy. These payment processors adhere to the standards set by PCI-DSS as managed by the PCI Security Standards Council, which is a joint effort of brands like Visa, Mastercard, American Express and Discover. PCI-DSS requirements help insure the secure handling of payment information.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>PayPal</span></p><p><span xss=removed>Their Privacy Policy can be viewed at https://www.paypal.com/webapps/mpp/ua/privacy-full</span></p><p><span xss=removed> </span></p><p><span xss=removed>GDPR Privacy</span></p><p><span xss=removed>Legal Basis for Processing Personal Data under GDPR</span></p><p><span xss=removed>We may process Personal Data under the following conditions:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Consent: you have given your consent for processing Personal Data for one or more specific purposes.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Performance of a contract: Provision of Personal Data is necessary for the performance of an agreement with you and/or for any pre-contractual obligations thereof.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Legal obligations: Processing Personal Data is necessary for compliance with a legal obligation to which the Company is subject.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Vital interests: Processing Personal Data is necessary in order to protect your vital interests or those of another natural person.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Public interest: Processing Personal Data is related to a task that is carried out in the public interest or in the exercise of official authority vested in the Company.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Legitimate interests: Processing Personal Data is necessary for the purposes of the legitimate interests of the Company.</span></p><p><span xss=removed>In any case, the Company will gladly help to clarify the specific legal basis that applies to the processing, and in particular whether the provision of Personal Data is a statutory or contractual requirement, or a requirement necessary to enter into a contract.</span></p><p><span xss=removed>Your Rights under the GDPR</span></p><p><span xss=removed>The Company undertakes to respect the confidentiality of your Personal Data and to guarantee you can exercise your rights. You have the right under this Privacy Policy, and by law if you are within the EU, to:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Request access to your Personal Data. The right to access, update or delete the information we have about you. Whenever made possible, you can access, update or request deletion of your Personal Data directly within your account settings section. If you are unable to perform these actions yourself, please contact us to assist you. This also enables you to receive a copy of the Personal Data we hold about you.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Request correction of the Personal Data that we hold about you. You have the right to have any incomplete or inaccurate information we hold about you corrected.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Object to processing of your Personal Data. This right exists where we are relying on a legitimate interest as the legal basis for our processing, and there is something about your particular situation which makes you want to object to our processing of your Personal Data on this ground. You also have the right to object where we are processing your Personal Data for direct marketing purposes.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Request erasure of your Personal Data. You have the right to ask us to delete or remove Personal Data when there is no good reason for us to continue processing it.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Request the transfer of your Personal Data. We will provide to you, or to a third-party you have chosen, your Personal Data in a structured, commonly used, machine-readable format. Please note that this right applies only to automated information which you initially consented for us to use or where we used the information to perform a contract with you.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Withdraw your consent. You have the right to withdraw your consent to our using your Personal Data. If you withdraw your consent, however, we may not be able to provide you with access to certain specific functionalities of the Website.</span></p><p><span xss=removed>Exercising your GDPR Data Protection Rights</span></p><p><span xss=removed>You may exercise your rights of access, rectification, cancellation and opposition by contacting us at Charlie@OutlineGurus.com. Please note that we may ask you to verify your identity before responding to such requests. If you make a request, we will try our best to respond to you as soon as possible.</span></p><p><span xss=removed>You have the right to complain to a Data Protection Authority about our collection and use of your Personal Data. For more information, if you are in the European Economic Area (EEA), please contact your local data protection authority in the EEA.</span></p><p><span xss=removed>CCPA Privacy</span></p><p><span xss=removed>This privacy notice section for California residents supplements the information contained in our Privacy Policy, and it applies solely to visitors, Users, Creators, Consumers and others who reside in the State of California USA.</span></p><p><span xss=removed>Categories of Personal Information Collected</span></p><p><span xss=removed>We collect information that identifies, relates to, describes, references, is capable of being associated with, or could reasonably be linked, directly or indirectly, with a particular Consumer or Device. The following is a list of categories of personal information which we may collect or may be collected from California residents.</span></p><p><span xss=removed>Please note that the categories and examples provided in the list below are those defined in the CCPA. This does not mean that all examples of that category of personal information are in fact collected by us, but reflects our good faith belief, to the best of our knowledge, that some information from the applicable category may have been collected. For example, certain categories of personal information would be collected only if you provided such personal information directly to us.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Category A: Identifiers.</span></p><p><span xss=removed>Examples: A real name, alias, postal address, unique personal identifier, online identifier, Internet Protocol address, email address, account name, driver\'s license number, passport number, or other similar identifiers.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Category B: Personal information categories listed in the California Customer Records statute (Cal. Civ. Code § 1798.80(e)).</span></p><p><span xss=removed>Examples: A name, signature, Social Security number, physical characteristics or description, address, telephone number, passport number, driver\'s license or state identification card number, insurance policy number, education, employment, employment history, bank account number, credit card number, debit card number, or any other financial information, medical information, or health insurance information. Some personal information included in this category may overlap with other categories.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Category C: Protected classification characteristics under California or USA federal law.</span></p><p><span xss=removed>Examples: Age (40 years or older), race, color, ancestry, national origin, citizenship, religion or creed, marital status, medical condition, physical or mental disability, sex (including gender, gender identity, gender expression, pregnancy or childbirth and related medical conditions), sexual orientation, veteran or military status, genetic information (including familial genetic information).</span></p><p><span xss=removed>Category D: Commercial information.</span></p><p><span xss=removed>Examples: Records and history of products or services purchased or considered.</span></p><p><span xss=removed>• Category E: Biometric information.</span></p><p><span xss=removed>Examples: Genetic, physiological, behavioral, and biological characteristics, or activity patterns used to extract a template or other identifier or identifying information, such as, fingerprints, face-prints, voiceprints, iris or retina scans, keystroke, gait, or other physical patterns, and sleep, health, or exercise data.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Category F: Internet or other similar network activity.</span></p><p><span xss=removed>Examples: Interaction with our Website or advertisement.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Category G: Geolocation data.</span></p><p><span xss=removed>Examples: Approximate physical location.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Category H: Sensory data.</span></p><p><span xss=removed>Examples: Audio, electronic, visual, thermal, olfactory, or similar information.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Category I: Professional or employment-related information.</span></p><p><span xss=removed>Examples: Current or past job history or performance evaluations.</span></p><p><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Category J: Non-public education information (per the Family Educational Rights and Privacy Act (20 U.S.C. Section 1232g, 34 C.F.R. Part 99)).</span></p><p><span xss=removed>Examples: Education records directly related to a student maintained by an educational institution or party acting on its behalf, such as grades, transcripts, class lists, student schedules, student identification codes, student financial information, or student disciplinary records.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Category K: Inferences drawn from other personal information.</span></p><p><span xss=removed>Examples: Profile reflecting a person\'s preferences, characteristics, psychological trends, predispositions, behavior, attitudes, intelligence, abilities, and aptitudes.</span></p><p><span xss=removed>Under CCPA, personal information does not include:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Publicly available information from government records</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>\"De-identified\" or aggregated consumer information</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Information excluded from the CCPA\'s scope, such as: Health or medical information covered by the Health Insurance Portability and Accountability Act of 1996 (HIPAA), the California Confidentiality of Medical Information Act (CMIA), or clinical trial data</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Personal Information covered by certain sector-specific privacy laws, including the Fair Credit Reporting Act (FRCA), the Gramm-Leach-Bliley Act (GLBA) or California Financial Information Privacy Act (FIPA), and the Driver\'s Privacy Protection Act of 1994.</span></p><p><span xss=removed>Sources of Personal Information</span></p><p><span xss=removed>We obtain the categories of personal information listed above from the following categories of sources:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Directly from you. For example, from the forms you complete on our Website, preferences you express or provide through our Website, or from your purchases on our Website.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Indirectly from you. For example, from observing your activity on our Website.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Automatically from you. For example, through Cookies we or our Service Providers set on your Device as you navigate through our Website.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>From Service Providers. For example, third-party vendors for payment processing, or other third-party vendors that we use to provide our Service to you.</span></p><p><span xss=removed>Our Use of Personal Information for Business or Commercial Purposes</span></p><p><span xss=removed>We may use or disclose personal information we collect for \"business purposes\" or \"commercial purposes\" (as defined under the CCPA), which may include the following:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>To operate our website and provide you with our Service.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>To provide you with support and to respond to your inquiries, including to investigate and address your concerns and monitor and improve our Service.</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></