le-tab-span\" xss=removed>    </span></span><span xss=removed>Charging different prices or rates for goods or services, including the use of different discounts or other benefits, or imposing penalties</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Providing a different level or quality of goods or services to you</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Suggesting that you will receive a different price or rate for goods or services or a different level or quality of goods or services</span></p><p><span xss=removed>Exercising your CCPA Data Protection Rights</span></p><p><span xss=removed>In order to exercise any of your rights under the CCPA if you are a California resident, you can contact us:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>By email: Charlie@OutlineGurus.com</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>By visiting this page on our website: www.OutlineGurus.com.</span></p><p><span xss=removed>Only you, or a person registered with the California Secretary of State that you authorize to act on your behalf, may make a verifiable request related to your personal information.</span></p><p><span xss=removed>Your request to us must:</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Provide sufficient information that allows us reasonably to verify you are the person about whom we collected personal information</span></p><p><span xss=removed>•</span><span xss=removed><span class=\"Apple-tab-span\" xss=removed>    </span></span><span xss=removed>Describe your request with detail sufficient to allow us properly to un