nable or disable DNT by visiting the preferences or settings page of your web browser.</span></p><p><span xss=removed>Children\'s Privacy</span></p><p><span xss=removed>Our Service does not address anyone under the age of 18. We do not knowingly collect personally identifiable information from anyone under the age of 18. If you are a parent or guardian and you are aware that your child has provided us with Personal Data, please contact us at Charlie@OutlineGurus.com. If we become aware that we have collected Personal Data from anyone under the age of 18 without verification of parental consent, we take steps to remove that information from our servers.</span></p><p><span xss=removed>Since use of our website is restricted to those above eighteen (18) years of age, OutlineGurus</span><span xss=removed>℠</span><span xss=removed> should have no information about any minor.  Users may be required to demonstrate proof of their over-18 status upon our request.</span></p><p><span xss=removed>Your California Privacy Rights (California\'s \"Shine the Light\" law)</span></p><p><span xss=removed>Under California Civil Code Section 1798 (California\'s \"Shine the Light\" law), California residents with an established business relationship with us can request information once a year about sharing their Personal Data with third parties for the third parties\' direct marketing purposes. If you would like to request more information under the California Shine the Light law, and if you are a California resident, you can contact us at Charlie@OutlineGurus.com.</span></p><p><span xss=removed>California Business and Professions Code section 22581 allows California residents under the age of 18 who are registered users of online websites, services or applications to request and obtain removal of content or information they have publicly posted. To request removal of such data if you are a California resident, you can contact us using the contact information provided below, and include th